लुम्बिनी प्रदेश सरकारले आज सार्वजनिक बिदा दिएको छ ।&amp;nbsp;

वसन्तपञ्चमी(श्रीपञ्चमी)को अवसरमा आज सार्वजनिक बिदा दिइएको आन्तरिक मामिला तथा कानून मन्त्रालयका सचिव लोकबहादुर सुनारले जानकारी दिए ।&amp;nbsp;

२०८१ चैत २१ गते प्रदेश राजपत्रमा सार्वजनिक स

मध्यपुरठिमी&amp;ndash;२ सानोठिमीस्थित बाल सुधारगृहमा झडप र आगजनी भएको छ ।

बाल सुधारगृहका दुई समूहबीच बिहीबार राति झडप, आगजनी र तोडफोड भएको हो ।&amp;nbsp;

आपसमा झडप भएपछि ठिमी प्रहरी वृत्तका प्रमुख नवराज ढुङ्गाना नेतृत्वको टोलीले सुधारगृह पुगेर स्थि

प्रतिनिधिसभा सदस्यका लागि उम्मेदवारी दिएका उम्मेदवारले आज दिउँसो १ बजेसम्म नाम फिर्ता लिन सक्ने निर्वाचन आयोगले जनाएको छ ।

निर्वाचन कार्यतालिकाअनुसार आज बिहान १० देखि दिउँसो १ बजेसम्म उम्मेदवारी फिर्ता लिन सक्नेछन् । &amp;nbsp;

आजै दिनको १ देखि ३ ब

नेपाल राष्ट्र बैंकले आज (शुक्रबार)का लागि विदेशी मुद्राको विनिमयदर निर्धारण गरेको छ । निर्धारण गरिएको विनिमयदरअनुसार अमेरिकन डलर एकको खरिददर १४६ रूपैयाँ ३२ पैसा र बिक्रीदर १४६ रूपैयाँ ९२ पैसा तोकिएको छ ।&amp;nbsp;
